import { Component } from "react";
import Signup from "./Signup";

class Welcome extends Component {
    constructor(props) {
        super(props);
        this.state = {
            hasAccount: true,
        }
    }

    render() {
        return this.state.hasAccount ? <Login /> : <Signup />;
    }
}

export default Welcome;
